var maxPartitionsAfterOperations = function(s, k) {
    if (k === 1) return s.length; // Every character needs to be its own partition.

    let ans = 0;
    for (let i = 0; i < s.length;) {
        let used = new Set(), changes = 0, j = i;
        while (j < s.length && (used.size < k || used.has(s[j]))) {
            if (!used.has(s[j])) {
                used.add(s[j]);
                changes++;
            }
            j++;
        }
        ans++;
        i = j; // Move to the next segment
    }

    return ans;
};
